import { Link } from 'react-router-dom';

function NousNovaHomePage(){
    return(
        <div className="HomePageGlobalDiv">
            <div className="nousnova-home">
                <section className="hero">
                    <div className="hero-text">
                    <h1>Bem-vindo à Nous Nova</h1>
                    <p>Uma nova era do conhecimento começa aqui.</p>
                    <p className="subtitle">Investigue, compreenda, transcenda.</p>
                    <Link to="/nousnova/about" className="btn-explore">
                        Conheça nossa filosofia
                    </Link>
                    </div>
                </section>

                </div>
        </div>
    )
}

export default NousNovaHomePage;
